import React from "react";
import "./Sidebar.css"
import '../../reset.css'

import checkMark from '../../imgs/green-check-mark-icon-png-11.jpg'

export default function SideBar() {
    return (
        <div className="sidenav">
            <LevelCounter/>
        </div>
    )
}

function LevelCounter() {
    return (
        <div className="level-counter">
            <p className="counter">Level {1} of {32}</p>
            <div className="checkmark-div">
               <p>{"& #10004"}</p>
            </div>
        </div>
    )
}
